import React from "react";
import ProfileInfo from "./ProfileInfo";
import Stats from "./Stats";

const Card = (props) => {
  return (
    <div className="card">
      <div className="card-background-top"></div>
      <div className="card-info">
        <ProfileInfo name={props.user.name} city={props.user.city} />
        <Stats />
      </div>
    </div>
  );
};

export default Card;
